ns8:collectingInfo.ns8:order:
Подача заявок на участие в запросе котировок в электронной форме осуществляется только лицами, зарегистрированными в единой информационной системе и аккредитованными на электронной площадке. Заявка на участие в запросе котировок в электронной форме состоит из предложений участника запроса котировок в электронной форме о предлагаемых товаре, работе, услуге, а также о цене контракта. Такая заявка направляется участником запроса котировок в электронной форме оператору электронной площадки.Участник запроса котировок в электронной форме вправе подать заявку на участие в таком запросе в любое время с момента размещения извещения о его проведении до предусмотренных извещением о запросе котировок в электронной форме даты и времени окончания срока подачи заявок на участие в таком запросе.
Участник запроса котировок в электронной форме вправе подать только одну заявку на участие в таком запросе.
В течение одного часа с момента получения заявки на участие в запросе котировок в электронной форме оператор электронной площадки возвращает указанную заявку подавшему ее участнику запроса котировок в электронной форме в случае:
1) подачи заявки с нарушением требований,
предусмотренных частью 6 статьи 24.1 Закона № 44-ФЗ;
2) подачи одним участником запроса котировок в
электронной форме двух и более заявок на участие в нем при условии, что поданные ранее заявки данным участником не отозваны. В указанном случае данному участнику возвращаются все заявки на участие в таком запросе;
3) получения заявки после даты или времени окончания срока подачи заявок на участие в таком запросе;
4) получения заявки от участника такого запроса с нарушением положений части 9 статьи 24.2 Закона № 44-ФЗ;
5) подачи участником такого запроса заявки, не содержащей предложение о цене контракта или содержащей предложение о цене контракта, превышающей начальную (максимальную) цену контракта или равной нулю;
